import { TextField } from "@mui/material"
import React, { ChangeEvent } from "react"
import { text } from "stream/consumers"

interface props {
    type: string
    label: string
    style: any
    emailid?: (loginEmail: string, loginPass: string) => void
    name: string
}

export default function Input({ type, label, style, emailid, name }: props) {
    const emailValueLogin = (event: ChangeEvent<HTMLInputElement>) => {
        if (emailid) {
            emailid(event.target.value, event.target.name)
        }
    }

    return (

        <TextField
            type={type}
            label={label}
            name={name}
            sx={{ ...style }}
            onChange={(event) => emailValueLogin(event)}
        />

    )
}
